import React from 'react'
import mug from '../../Images/mug.jpg';
import './product.css';

const Product = () => {
    return (
        <div className='product'>
            <div>
                <img src={mug} className='product_size' alt="" />
                <div className='product_desc'>
                    <h2>Hydro Flask Mug - Stainless Steel</h2>
                    <br />
                    <p>$93.82 Shipping & Import Fees Deposit to Pakistan <br /> Details Available at a lower price from other sellers that may not offer <br /> free Prime shipping.</p>
                    <br />
                    <h2>$27.95</h2>
                </div>
            </div>
        </div>
    )
}

export default Product
